import React, { useState, useEffect } from 'react';

const GetRest = () => {
    const [posts, setPosts] = useState([]);
    useEffect(() => {
        console.log('hello');
        fetch('http://192.168.1.26:8050/api/records/')
            .then((response) => response.json())
            .then((data) => {
                let records = []
                const number = Object.keys(data).length;
                for (let i = number - 10; i < number; i++) {
                    records.push(data[i])
                }
                console.log(records);
                setPosts(records);
            })
            .catch((err) => {
                console.log(err.message);
            });
    }, []);

    return (
        <div className="hi">
            Object.keys(posts.object).map((key, i) => (
            <p key={i}>
                <span>Key Name: {key}</span>
                <span>Value: {sampleJSON.object[key]}</span>
            </p>
            )
        </div>)
}

export default GetRest;
